import React from 'react';
import { Flex, Progress, Card, Space, } from 'antd';


export const Charp = () => (
  <Flex gap="small" vertical>
   
    <Progress  type="dashboard" percent={50} status="active" />
    <Progress type="dashboard"  percent={70} status="exception" />
    <Progress percent={100} />SFS
    <Progress percent={50} showInfo={false} />

    <Space direction="vertical" size={16}>
  <Card
    title="Default size card"
   
    style={{
      width: 300,
    }}
  >
     <Progress percent={30} /> 
    <p>Card content</p>
    <p>Card content</p>
  </Card>
  <Card
    size="small"
    title="Small size card"
    extra={<a href="#">More</a>}
    style={{
      width: 300,
    }}
  >
    <p>Card content</p>
    <p>Card content</p>
    <p>Card content</p>
  </Card>
</Space>
  </Flex>
  
)
